import React, { useState } from 'react'


const Country = ({data}) => {
    const country = data[0];
    console.log('countries.', country.languages)
    const lan = Object.values(country.languages);
    console.log('keys.', lan)
    let languages = []
    for (let i = 0; i < lan.length; i++) {
        languages.push(country.languages[lan[i]])
    }
    console.log('languages.', languages)
    return (
        <>
            <h1>{country.name.common}</h1>
            <p>capital {country.capital}<br />
            population {country.population}
            </p>
            <br />
            <h3>Languages </h3>
            <ul>
                {country.languages.map(language => {                     
                    <li > {Object.values(country.languages)}</li>
        
                } 
                )}
            </ul>
            <br />
            <img src={country.flags.png} alt='flag-image' />
        </>
    )
}

export default Country
